tables.table_schema:
CREATE TABLE clickstream_data (
    user_id INT,
    page_id INT,
    timestamp TIMESTAMP,
    action VARCHAR(50)
);

CREATE TABLE user_engagement_data (
    user_id INT PRIMARY KEY,
    event_type VARCHAR(50),
    timestamp TIMESTAMP,
    duration INT
);

CREATE TABLE website_design (
    design_id INT PRIMARY KEY,
    page_name VARCHAR(50),
    color_scheme VARCHAR(50),
    layout_scheme VARCHAR(50)
);

CREATE TABLE ClickstreamData (
  id INT PRIMARY KEY,
  user_id INT,
  timestamp TIMESTAMP,
  action VARCHAR
);

CREATE TABLE UserData (
  user_id INT PRIMARY KEY,
  name VARCHAR,
  email VARCHAR
);

CREATE TABLE WebsiteAnalytics (
  page_id INT PRIMARY KEY,
  url VARCHAR,
  visits INT,
  bounce_rate FLOAT
);

CREATE TABLE Users (
  user_id INT PRIMARY KEY,
  email VARCHAR UNIQUE,
  first_name VARCHAR,
  last_name VARCHAR
);

CREATE TABLE Pages (
  page_id INT PRIMARY KEY,
  page_url VARCHAR,
  page_title VARCHAR,
  category VARCHAR
);

CREATE TABLE Sessions (
  session_id INT PRIMARY KEY,
  user_id INT,
  start_time TIMESTAMP,
  end_time TIMESTAMP
);

CREATE TABLE Actions (
  action_id INT PRIMARY KEY,
  action_name VARCHAR,
  action_description TEXT,
  action_type VARCHAR
);
